  amrex::Real g_RT[22];
  gibbs(g_RT, tc);
  amrex::Real g_RT_qss[10];
  gibbs_qss(g_RT_qss, tc);

  amrex::Real sc_qss[10];
  amrex::Real kf_qss[142], qf_qss[142], qr_qss[142];
  // Fill sc_qss here
  comp_k_f_qss(tc, invT, kf_qss);
  comp_qss_coeff(kf_qss, qf_qss, qr_qss, sc, tc, g_RT, g_RT_qss);
